Magpie
```json
{
  "application": "Magpie",
  "description": "Magpie is a collection of scripts for running Hadoop on traditional HPC systems.",
  "software_requirements": [
    {
      "name": "Hadoop",
      "version": "2.9.1",
      "configuration": {
        "setup": "yes",
        "setup_type": "MR",
        "home": "${HOME}/hadoop-${HADOOP_VERSION}",
        "local_dir": "/tmp/${USER}/hadoop"
      }
    },
    {
      "name": "Pig",
      "version": "0.17.0",
      "configuration": {
        "setup": "yes",
        "home": "${HOME}/pig-${PIG_VERSION}",
        "local_dir": "/tmp/${USER}/pig"
      }
    },
    {
      "name": "Java",
      "version": "1.7.0",
      "home": "/usr/lib/jvm/jre-1.7.0/"
    }
  ],
  "resource_requirements": {
    "scheduler": "Moab",
    "remote_shell": "pdsh",
    "submission_type": "msubtorquepdsh"
  },
  "job_type": "pig",
  "job_name": "<my_job_name>",
  "account": "<my_account_string>",
  "nodes": "<my_node_count>",
  "partition": "<my_partition>",
  "queue": "<my_batch_queue>",
  "walltime": "<my_time_in_seconds_or_HH:MM:SS>"
}
```
